import { Form } from "../../UI/Form";
import { QuizCreationStartingValues } from "../../../constants/formInputsValues";

export const QuizCreationForm: React.FC = () => {
  return (
    <Form
      title="Create your quiz"
      scope="quizCreation"
      inputs={QuizCreationStartingValues}
    />
  );
};
